import { useParams } from "react-router-dom";

const UserComponent = () => {
  const params = useParams();

  const { id } = useParams();

  return (
    <div>
      <h2>User ID: {params.id}</h2>
      <h2>User ID: {id}</h2>
    </div>
  );
};

export default UserComponent;
